import React, { Component } from "react";
import { Row, Col, Layout } from "antd";
import Menu from "../components/Menu";
import Logo from "../components/Logo";
import styled from "styled-components";

const Contents = styled(Row).attrs(() => ({ type: "flex" }))`
  margin-top: 1px;
  background-color: #f3f7f820;
  margin-left: auto;
  margin-right: auto;
  width: 1400px;
  height: 700px;
`;

const Contact__Label = styled.div`
  color: white;
  font-weight: bold;
  font-size: 25px;
  margin-left: 40px;
`;

const { Footer } = Layout;
export class Contact extends Component {
  render() {
    const pathname = this.props.location.pathname;
    return (
      <Row
        type="flex"
        align="middle"
        style={{ background: "#0a262e", height: "1120px" }}
      >
        <Col span={24} style={{ textAlign: "center" }}>
          <Logo />
          <Menu pathname={pathname} />
        </Col>
        <Contents>
          <Col span={24}>
            <Contact__Label>Email</Contact__Label>

            <div
              style={{
                color: "white",
                marginLeft: "60px",
                marginBottom: "20px"
              }}
            >
              fdsa0329@naver.com
            </div>
            <Contact__Label>KaKao Talk</Contact__Label>

            <div
              style={{
                color: "white",
                marginLeft: "60px",
                marginBottom: "20px"
              }}
            >
              songzzang-_-92@hotmail.com
            </div>
          </Col>
        </Contents>
        <Col span={24}>
          <Footer style={{ textAlign: "center", background: "#0a262e" }}>
            Eddie Sunny Design Â©2019 Created by Eddie Sunny
          </Footer>
        </Col>
      </Row>
    );
  }
}

export default Contact;
